import axios from 'axios';

const KEY = 'AIzaSyAZ0oe0K_-SLetmJE_IxFBAmqK_qtkLY_A';

export default axios.create({
    baseURL: 'https://www.googleapis.com/youtube/v3',
    params: {
        part: 'snippet',
        type: 'video',
        maxResults: 1,
        key: KEY
    }
});
